<h1 class="Section4">
<a class="Section5" href="#" id="introduction">Introduction</a>
</h1>
<div class="Section6"><br><b>TortoiseGit </b>est une interface Windows Shell pour Git et basée sur TortoiseSVN. Il est open source et peut être entièrement construit avec des logiciels disponibles gratuitement.

Comme il ne s'agit pas d'une intégration pour un IDE spécifique comme Visual Studio, Eclipse ou autres, vous pouvez l'utiliser avec tous les outils de développement que vous aimez et avec n'importe quel type de fichier. L'interaction principale avec TortoiseGit utilisera le menu contextuel de l'explorateur Windows.

TortoiseGit vous assiste par des tâches régulières, telles que la validation, l'affichage des journaux, la différence entre deux versions, la création de branches et de balises, la création de correctifs, etc.

Il est développé sous licence GPL . Ce qui signifie que son utilisation est entièrement gratuite pour quiconque, y compris dans un environnement commercial, sans aucune restriction. Le code source est également disponible gratuitement, vous pouvez donc même développer votre propre version si vous le souhaitez.<br><br><div class="GImg1 Img1"><img alt="image.png" src="data:image/png;base64,"></div><br></div>
</div>
</div>
</div><br><div class="GSection1 Section1">
<div class="Section2">
<div class="Section3">
<h1 class="Section4">
<a class="Section5" href="#" id="renommage-d-un-dossier">Renommage d'un dossier</a>
</h1>
<div class="Section6"><br>Nous essayerons de renommer le dossier (controle_version) en (versioning).<br><br>Pour renommer un dossier:<br><br>Faire un clic droit sur le dossier pour afficher le menu contextuel.<br>Afficher plus d'options.<br>Ouvrir l'interface de renommage.<br><br><div class="GImg1 Img1"><img alt="image.png" src="data:image/png;base64,"></div><br>Renommer le dossier.<br><br><div class="GImg1 Img1"><img alt="image.png" src="data:image/png;base64,"></div><br></div>
</div>
</div>
</div><br><div class="GSection1 Section1">
<div class="Section2">
<div class="Section3">
<h1 class="Section4">
<a class="Section5" href="#" id="nettoyage-du-depot">Nettoyage du dépôt</a>
</h1>
<div class="Section6"><br>Nous essayerons de nettoyer le dépôt local suite à plusieurs modifications qui devront être abandonnées.<br><br>Pour nettoyer le dépôt local:<br><br>Faire un clic droit dans un espace vide du dépôt pour afficher le menu contextuel.<br>Afficher plus d'options.<br>Ouvrir l'interface de nettoyage.<br><br><div class="GImg1 Img1"><img alt="image.png" src="data:image/png;base64,"></div><br></div>
</div>
</div>
</div><br><div class="GSection1 Section1">
<div class="Section2">
<div class="Section3">
<h1 class="Section4">
<a class="Section5" href="#" id="merge-de-branches">Merge de branches</a>
</h1>
<div class="Section6"><br>Nous essayerons de merger la branche de développement (2.1) dans la branche de référence (main).<br><br>Pour merger des branches:<br><br>Faire un clic droit dans un espace vide du dépôt pour afficher le menu contextuel.<br>Afficher plus d'options.<br>Ouvrir l'interface de changement de branche.<br><br><div class="GImg1 Img1"><img alt="image.png" src="data:image/png;base64,"></div><br>Basculer sur la branche de référence (main).<br><br><div class="GImg1 Img1"><img alt="image.png" src="data:image/png;base64,"></div><br>Ouvrir l'interface de merge.<br><br><div class="GImg1 Img1"><img alt="image.png" src="data:image/png;base64,"></div><br>Sélectionner la branche de développement (2.1).<br>Cocher l'option (No Fast Forward).<br><br>L'option (No Fast Forward) correspond au drapeau (--no-ff).&nbsp;Il empêche (git merge) ou (git pull) d'exécuter un (fast-forward) s'il détecte que le HEAD courant est un ancêtre du commit que vous essayez de fusionner. Cela empêche git de déplacer simplement votre pointeur de branche vers le commit entrant. Et ainsi, de conserver la topologie des branches de fusion en créant un point de fusion.<br><br><div class="GImg1 Img1"><img alt="image.png" src="data:image/png;base64,"></div><br>Ouvrir l'interface de résolution de conflits.<br><br><div class="GImg1 Img1"><img alt="image.png" src="data:image/png;base64,"></div><br>Ouvrir l'outil de résolution de conflits.<br><br><div class="GImg1 Img1"><img alt="image.png" src="data:image/png;base64,"></div><br>Nous avons 15 conflits au total.<br>10 conflits ont été résolus automatiquement.<br>5 conflits sont encore non résolus.<br><br><div class="GImg1 Img1"><img alt="image.png" src="data:image/png;base64,"></div><br>Faire un clic droit sur un conflit de merge.<br>Sélectionner les lignes à intégrer dans la résolution.<br><br><div class="GImg1 Img1"><img alt="image.png" src="data:image/png;base64,"></div><br>Visualiser la résolution du conflit.<br><br><div class="GImg1 Img1"><img alt="image.png" src="data:image/png;base64,"></div><br>Marquer le fichier comme résolu.<br><br><div class="GImg1 Img1"><img alt="image.png" src="data:image/png;base64,"></div><br></div>
</div>
</div></div><br><div class="GSection1 Section1">
<div class="Section2">
<div class="Section3">
<h1 class="Section4">
<a class="Section5" href="#" id="sauvegarde-des-modifications">Sauvegarde des modifications</a>
</h1>
<div class="Section6"><br>TortoiseGit fournit avec la commande (git stash) permettant de stocker localement toutes les modifications les plus récentes dans un espace de travail et réinitialise l'état de l'espace de travail à l'état de validation précédent. Un utilisateur peut récupérer tous les fichiers placés dans la réserve avec les commandes (git stash pop) et (git stash apply).<br><br>Pour sauvegarder des modifications localement:<br><br>Faire un clic droit dans un espace vide du dépôt pour afficher le menu contextuel.<br>Afficher plus d'options.<br>Ouvrir l'interface de sauvegarde locale.<br><br><div class="GImg1 Img1"><img alt="image.png" src="data:image/png;base64,"></div><br>Définir le nom de la réserve.<br><br><div class="GImg1 Img1"><img alt="image.png" src="data:image/png;base64,"></div><br>Fermer.<br><br><div class="GImg1 Img1"><img alt="image.png" src="data:image/png;base64,"></div><br></div>
</div></div></div><br><div class="GSection1 Section1">
<div class="Section2">
<div class="Section3">
<h1 class="Section4">
<a class="Section5" href="#" id="recuperation-des-modifications">Récupération des modifications</a>
</h1>
<div class="Section6"><br>TortoiseGit fournit avec la commande (git stash) permettant de stocker localement toutes les modifications les plus récentes dans un espace de travail et réinitialise l'état de l'espace de travail à l'état de validation précédent. Un utilisateur peut récupérer tous les fichiers placés dans la réserve avec les commandes (git stash pop) et (git stash apply).<br><br>Pour récuperer des modifications localement:<br><br>Faire un clic droit dans un espace vide du dépôt pour afficher le menu contextuel.<br>Afficher plus d'options.<br>Ouvrir l'interface de récupération locale.<br><br><div class="GImg1 Img1"><img alt="image.png" src="data:image/png;base64,"><br><br></div>Afficher les modifications.<br><br><div class="GImg1 Img1"><img alt="image.png" src="data:image/png;base64,"></div><br>Valider.<br><br><div class="GImg1 Img1"><img alt="image.png" src="data:image/png;base64,"></div><br></div></div></div></div><br><div class="GSection1 Section1">
<div class="Section2">
<div class="Section3">
<h1 class="Section4">
<a class="Section5" href="#" id="configurer-kdiff3-dans-tortoisegit">Configurer KDiff3 dans TortoiseGit</a>
</h1>
<div class="Section6"><br>Nous essayerons de configurer KDiff3 dans TortoiseGit.<br><br>Pour configurer KDiff3 dans TortoiseGit:<br><br>Faire un clic droit dans un espace vide du dépôt pour afficher le menu contextuel.<br>Afficher plus d'options.<br>Ouvrir l'interface de configuration de l'outil de merge.<br>&nbsp;<br><div class="GImg1 Img1"><img alt="image.png" src="data:image/png;base64,"></div><br>Configurer KDiff3.<br><br><div class="GImg1 Img1"><img alt="image.png" src="data:image/png;base64,"></div><br></div>
